🤸🏽‍♀️Fit Arts Style⁣⁣🤸🏼
⁣⁣
I spent a little over a month in LA before all the madness started and during that time I was able to train at Fit Arts! I found so much inspiration from all the girls that train so hard.  Surrounded by uplifting spirits and dedicated woman I was pushed in every single class. I left smiling and feeling fulfilled and happy. ⁣⁣
⁣⁣
SOO.... I was beyond thrilled when the multi-talented girls of @fitarts asked me to participate in the #dontrushchallenge!  How cool and impressive are all these ninja skills from these ladies??? ⁣⁣
⁣⁣
Thank you Alfred Kendrick, the mastermind behind @fitarts for improving my skills and more importantly for connecting me with these ladies! ⁣⁣
⁣⁣
